import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <div className="hero">
      <div className="hero-topic">
        <h3>Rent a reliable and affordable car for your next adventure</h3>
      </div>
      <div className="hero-description">
        ur car rental website offers a variety of reliable and affordable
        vehicles for customers to rent for their next adventure. We offer
        competitive rates, insurance options, and a variety of vehicle upgrades
        to meet the unique needs of our customers.
      </div>
    </div>
  );
}

export default Hero;
